                report.metrics.backtest.nextTradingDate = new Date(report.metrics.backtest.nextTradingDate)
                report.metrics.backtest.livePerformanceStart = new Date(report.metrics.backtest.livePerformanceStart)


                    function convertTrade(trade) {
                        return Object.fromEntries(
                            Object.entries(trade).map(([key, val]) => {
                            let newkey = key;
                            let newval = val;

                    switch (key) {
                        case 'bmfe':
                        break;
                        case 'entry_date':
                        newkey = 'entry';
                        newval = val ? new Date(val) : null;
                        break;
                        case 'entry_index':
                        newkey = 'entryIndex';
                        break;
                        case 'entry_sig_date':
                        newkey = 'entrySig';
                        newval = val ? new Date(val) : null;
                        break;
                        case 'exit_date':
                        newkey = 'exit';
                        newval = val ? new Date(val) : null;
                        break;
                        case 'exit_index':
                        newkey = 'exitIndex';
                        break;
                        case 'exit_sig_date':
                        newkey = 'exitSig';
                        newval = val ? new Date(val) : null;
                        break;
                        case 'gmfe':
                        case 'mae':
                        case 'mdd':
                        case 'pdays':
                        case 'period':
                        case 'position':
                        case 'return':
                        break;
                        case 'stock_id':
                        newkey = 'stockId';
                        break;
                        case 'trade_price@entry_date':
                        newkey = 'entryPrice';
                        break;
                        case 'trade_price@exit_date':
                        newkey = 'exitPrice';
                        break;
                    }
                    return [newkey, newval];
                    })
                );

                }

                let theme = 'dark'

                if (window.matchMedia && window.matchMedia('(prefers-color-scheme: dark)').matches) {
                    console.log('User prefers dark theme');
                } else {
                    console.log('User prefers light theme or has no preference');
                    theme = 'light'
                }
                theme = localStorage.getItem('theme') || theme

                document.documentElement.setAttribute('data-theme', theme);
                report.trades = report.trades.map(convertTrade)

                console.log(report)

                const div = document.getElementById('panel')

                const analytic = new StrategyAnalytic({
                    target: div,
                    props: {
                        report: report,
                        browser: true,
                        theme: theme,
                        lang: 'zh-tw',
                        reportPosition: positionJson,
                        webcomponent: true
                    }
                });

                function updateIconColor() {
                    const theme = analytic.theme
                    const textColor = theme === 'light' ? 'black' : 'white';
                    const elements = document.querySelectorAll('.fill-current');
                    elements.forEach(element => {
                        element.style.color = textColor
                    });
                    
                }

                document.getElementById('theme-toggler').addEventListener('change', (e) => {
                    const theme = analytic.theme === 'light' ? 'dark' : 'light'
                    document.documentElement.setAttribute('data-theme', theme);
                    analytic.theme = theme;
                    localStorage.setItem('theme', theme);
                    updateIconColor();

                });

                updateIconColor()



                

            </script>
